INSERT INTO `cl_news` VALUES
  (1,'Loser eldade upp halv mille','En man i Jönköping misstänks för att ha eldat upp närmare en halv  miljon i kontanter i samband med en skilsmässa och personlig konkurs.\r\n  Det är konkursförvaltaren som polisanmält mannen, uppger Sveriges\r\n  Radio Jönköping. \r\n\r\n  Misstanken gäller grov oredlighet mot borgenär. Enligt konkurs förvaltaren eldade mannen upp pengarna bland annat för att hans före  detta hustru inte skulle få del av dem. \r\n  Pengabrasan fick också till följd att mannen försattes i personlig  konkurs. (TT)','2002-02-18','20:10:12'),
  (3,'Strålning hotar storleken','När Statstjänstemannaförbundet första gången krävde strålningsfria bildskärmar var det ingen som lyssnade. Men när en expert på Arbetarsskyddstyrelsen berättat om ett försök, där det visat sig att elektromagnetisk strålning orsakar förkrympta könsorgan, då hände det saker. Och kravet togs på allvar. Allt enligt Peter Magnusson på Statstjänstemannaförbundet.\r\n(Källa: Dagens IT)\r\n\r\n#27','2002-02-06','17:11:15'),
  (26,'Strecklista sportstugearret','nr;50cl;33cl;sprit\r\n#1 6 1 0\r\n#5 3 3 0\r\n#6 5 3 3\r\n#69 5 2 2\r\n#13 8 2 3\r\nP2 3 2 0\r\nP4 5 3 0\r\nP7 5 3 2','2002-05-02','23:56:53'),
  (222,'Test av L-cystein mot bakfylla','Jag har under senaste åren kunnat utröna att efter sex enheter mår jag piss en halv dag och efter tio enheter kan jag glömma att ens fundera på mat dagen efter. Därför blev jag väldigt nyfiken när följande postades på sidan\r\n\r\nÄntligen! https://interestingengineering.com/hangover-cure-reduces-headaches-anxiety-for-drunk-finnish-subjects\r\n#62 @ Karta | 2020-08-21, 10:47:10 (fre) \r\n\r\nDet visade sig att jag kunde beställa medlet på nätet och hade en kräftskiva inplanerad helgen efter. Time for science!\r\n\r\nHypotes:\r\nGenom att hålla en hög nivå av L-cystein i kroppen under supande blir baksmällan lättare.\r\n\r\nMetod:\r\nTre försökspersoner med normalt till lätt överviktigt bmi, två män j j en kvinna, tog 1 kapsel med 500 mg L-cystein innan supande och en 1 kapsel vid kulmen av supande. Normal kräftskivekonsumtion av alkohol. Försökspersonernas mående rapporterades anekdotiskt dagen efter.\r\n\r\nResultat:\r\nTvå av försökspersonerna rapporterade att de mådde fina fisken, bättre än de hade förväntat sig. Den tredje som enligt egen utsago gick ut hårdare än väntat var däremot så trasig som han förväntade sig. Till protokollet ska även tilläggas att han gick upp mitt i natten för att spy och att han  tog i lite för mycket för att ett litet piller skulle räddas mig .\r\n\r\nDiskussion:\r\nDå författaren deltog i studien och är väldigt bekant med förväntad nivå av bakfylla efter olika grader av alkoholintag kan han säga att han kände sig oförtjänt pigg, nästan som att han hade fuskat. Författarens sambo konstaterade att det inte fanns några tvivel om att dennes berusningsnivå kvällen innan var av en nivå som tidigare föranlett fosterställning, snabbantning och ångestdusch.\r\n\r\nSlutsats:\r\nUnderlaget är för litet för att dra några slutsatser, men den här preliminära studien tyder på att det finns fog att fortsätta utvärdera metoden.','2020-08-30','12:16:39');
